import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Link, Switch, Route}  from "react-router-dom";

import App from './App';

ReactDOM.render(
  <BrowserRouter>
  {/* <Link to="/admin"> Админ хуудас    </Link>
  <Link to="/home">   Нүүр хуудас       </Link> */}

  <Switch>
          <Route exact path="/dash">
            <Dashboard />
          </Route>
          <Route path="/admin">
            <Admin />
          </Route>
          <Route path="/" exact>
            <App />
          </Route>
        </Switch>

  </BrowserRouter>
 ,
  document.getElementById('root')
);
function Admin(){
  return(
    <div>
      admin
    </div>
  )
}
function Home(){
  return(
    <div>Home</div>
  )
}
function Dashboard(){
  return(
    <div>Dashboard</div>
  )
}
